import styled from 'styled-components';

const ImageWrapper = styled.img`
       width: 200Px;
       height: 300px;
       border:2px solid grey;
       margin:10px
    `;

const AnchorWrapper = styled.a`
     text-decoration:none;`
const H3Wrapper = styled.h3`
   color:'solid black;
    fontSize:'20px';
    marginTop:'2px'; 
    marginLeft:'80px;
    width:'200px';

`;
const PWrapper = styled.p`
  color:'black';
  fontSize:'15px';
  marginTop:'1px';
  marginLeft:'70px';
  height:'30px';
`;
function Product(props){

        return(
            <div>
                <AnchorWrapper href="https://google.com">
            <ImageWrapper src ="https://assets.myntassets.com/h_720,q_90,w_540/v1/assets/images/12446056/2021/9/9/d5a1d37a-a720-46d4-a296-feb7f89426e91631181327161FlyingMachineMenOliveGreenSolidBomberJacket1.jpg"/>      
            </AnchorWrapper>
            <div className='Zara'>
             <H3Wrapper>{props.brand}</H3Wrapper>
            </div>
            <p>${props.price}</p>
           </div>

           
        );

    }

    export default Product;
